<script type="text/javascript">
function mapInfo(x) {
	let popup = document.getElementById(x);
	popup.classList.toggle('show');
	let clear = document.getElementById('clear-container');
	clear.setAttribute('pointer-events', 'all');
	let rect = document.querySelectorAll('rect');
	for (let a = 0; a < rect.length; a++) {
	rect[a].classList.toggle('hide');
	rect[a].setAttribute('pointer-events','none');
	};
	clear.onclick = function () {
	popup.classList.toggle('show');
	for (let a = 0; a < rect.length; a++) {
	rect[a].classList.toggle('hide');
	rect[a].setAttribute('pointer-events','all');
	};
	clear.setAttribute('pointer-events','none');
	}
}
</script>

  <!-- ADS Carrels --> 
	<g pointer-events="none"><foreignObject class="info left" x="418" y="256" width="40%" height="95%"><span class="map-info" id="adscarrels-info"><p>Four of our study carrels are reserved for students who have registered with campus Accessibility & Disability Service (ADS) to request accommodations. The ADS carrels offer adjustable height tables, and students can use these spaces to study for up to two hours at a time.</p></span></foreignObject></g>
  <!-- ADS Carrels rectangle -->
	<g id="adscarrels" data-name="Rectangle 1" class="l">
    <g id="d" data-name="Rectangle 1">
      <rect class="k" x="531" y="298.15" width="43" height="65.69" onclick="mapInfo('adscarrels-info')"/>
    </g>
  </g>
 <!-- Instruction Rooms -->
 <g pointer-events="none"><foreignObject class="info right" x="800" y="300" width="30%" height="95%"><span class="map-info" id="instruction-info"><p>These three classrooms are used by librarians to teach sessions. Professors from any department can contact the library to set up special instructional sessions for their courses, so librarians can introduce students to useful resources and strategies for their research assignments. </p></span></foreignObject></g> 
 <!-- Instruction Rooms rectangle -->
 <g id="instruction" data-name="Rectangle 4" class="l">
    <g id="f" data-name="Rectangle 4">
      <rect class="k" x="1047" y="435" width="131" height="332" onclick="mapInfo('instruction-info')"/>
    </g>
  </g>
<!-- Study area -->
<g pointer-events="none"><foreignObject class="info center" x="445" y="452" width="40%" height="95%"><span class="map-info" id="studyarea-info"><p>The lowest floors of McKeldin Library are mostly designed for collaboration, noise, and activity. As you move to higher floors, study areas become quiet zones where people work individually and expect noise to be kept to a minimum. To help students focus, our policies for these quiet floors ask for limiting conversations, silencing cell phones and other devices, speaking softly, and using headphones.</p></span></foreignObject></g>
 <!-- Study area rectangle -->
	<g id="studyarea" data-name="Rectangle 3" class="l">
    <g id="h" data-name="Rectangle 3">
      <rect class="k" x="558" y="480" width="316" height="117" onclick="mapInfo('studyarea-info')"/>
    </g>
  </g>
<!-- GIS Lab -->
<g pointer-events="none"><foreignObject class="info center" x="687" y="500" width="40%" height="95%"><span class="map-info" id="gis-info"><p>The GIS/Data Lab provides people affiliated with UMD with free access to special software that can be used for geospatial data, data science, and data visualization. Users can also request virtual access to the lab to access the software remotely from a different location. Anyone who would like extra help with their project or the software can reach out to the library's GIS and Data Services Librarian for assistance.</p></span></foreignObject></g>
